//SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

contract Score {
    uint score;
    address owner;

    event NewScore(uint _newScore);

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner {
        if(msg.sender == owner) {
            _;
        }
    }

    function calculateScoreBonus(uint _reward) public returns (uint) {
        score = score * _reward;
        return score;
    }

    function getScore() public view returns (uint) {
        return score;
    }

    function setScore(uint _newScore) public onlyOwner {
        score = _newScore;

        emit NewScore(score); // this is the event declared above
    }
}

